--
-- Table structure for table `gc_area`
--

DROP TABLE IF EXISTS `gc_area`;
CREATE TABLE `gc_area`
(
    `id`           bigint(64)    NOT NULL AUTO_INCREMENT COMMENT '主键',
    `name`         varchar(255)  NOT NULL DEFAULT '' COMMENT '区域名称',
    `code`         varchar(255)  NOT NULL DEFAULT '' COMMENT '区域编码',
    `biz_code`     varchar(255)  NOT NULL DEFAULT '' COMMENT '区域业务编码',
    `type`         char(1)       NOT NULL DEFAULT '' COMMENT '区域类型(国家1、省份直辖市2、地市3、区县4)',
    `parent_id`    bigint(64)    NOT NULL DEFAULT '0' COMMENT '上级区域id',
    `ids`          varchar(1024) NOT NULL DEFAULT '' COMMENT '区域id序列，多个之间使用分隔符隔开',
    `names`        varchar(1024) NOT NULL DEFAULT '' COMMENT '区域名称序列，多个之间使用分隔符隔开',
    `codes`        varchar(1024) NOT NULL DEFAULT '' COMMENT '区域编码序列，多个之间使用分隔符隔开',
    `biz_codes`    varchar(1024) NOT NULL DEFAULT '' COMMENT '区域业务编码序列，多个之间使用分隔符隔开',
    `has_children` tinyint(4)    NOT NULL DEFAULT '0' COMMENT '是否有子节点(0:没有，1：有)',
    `order_num`    int(11)       NOT NULL DEFAULT '0' COMMENT '排序号',
    `remark`       varchar(255)  NOT NULL DEFAULT '' COMMENT '备注',
    `tenant_id`    bigint(64)    NOT NULL DEFAULT '2' COMMENT '租户id',
    `org_id`       bigint(64)    NOT NULL DEFAULT '1' COMMENT '机构id',
    `create_by`    bigint(64)    NOT NULL DEFAULT '2' COMMENT '创建者',
    `create_date`  timestamp     NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
    `update_by`    bigint(64)    NOT NULL DEFAULT '2' COMMENT '更新者',
    `update_date`  timestamp     NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间',
    `del_flag`     tinyint(4)    NOT NULL DEFAULT '0' COMMENT '删除标记0:保留，1:删除',
    PRIMARY KEY (`id`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8mb4
  COLLATE = utf8mb4_bin COMMENT ='区域表';


--
-- Table structure for table `gc_category`
--

DROP TABLE IF EXISTS `gc_category`;
CREATE TABLE `gc_category`
(
    `id`           bigint(64)    NOT NULL AUTO_INCREMENT COMMENT '分类字典id',
    `parent_id`    bigint(64)    NOT NULL DEFAULT '0' COMMENT '父级id',
    `ids`          varchar(1500) NOT NULL DEFAULT '' COMMENT 'id序列',
    `name`         varchar(255)  NOT NULL DEFAULT '' COMMENT '名称',
    `code`         varchar(255)  NOT NULL DEFAULT '' COMMENT '编码',
    `order_num`    int(11)       NOT NULL DEFAULT '0' COMMENT '排序编码',
    `remark`       varchar(255)  NOT NULL DEFAULT '' COMMENT '备注',
    `status`       tinyint(4)    NOT NULL DEFAULT '0' COMMENT '状态0:正常,1:禁用',
    `tenant_id`    bigint(64)    NOT NULL DEFAULT '2' COMMENT '租户id',
    `org_id`       bigint(64)    NOT NULL DEFAULT '1' COMMENT '机构id',
    `create_by`    bigint(64)    NOT NULL DEFAULT '2' COMMENT '创建者',
    `create_date`  timestamp     NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
    `update_by`    bigint(64)    NOT NULL DEFAULT '2' COMMENT '更新者',
    `update_date`  timestamp     NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间',
    `del_flag`     tinyint(4)    NOT NULL DEFAULT '0' COMMENT '删除标记0:保留,1:删除',
    `has_children` tinyint(64)   NOT NULL DEFAULT '0' COMMENT '是否有子节点0:没有，1:有',
    PRIMARY KEY (`id`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8mb4
  COLLATE = utf8mb4_bin COMMENT ='分类字典表';



--
-- Table structure for table `gc_company`
--
DROP TABLE IF EXISTS `gc_company`;
CREATE TABLE `gc_company`
(
    `id`           bigint(64)    NOT NULL AUTO_INCREMENT COMMENT '主键',
    `name`         varchar(255)  NOT NULL DEFAULT '' COMMENT '公司名称',
    `full_name`    varchar(255)  NOT NULL DEFAULT '' COMMENT '公司全称',
    `code`         varchar(255)  NOT NULL DEFAULT '' COMMENT '公司编码',
    `area_id`      bigint(64)    NOT NULL DEFAULT '0' COMMENT '区域id',
    `has_children` tinyint(4)    NOT NULL DEFAULT '0' COMMENT '是否有子节点(0:没有，1：有)',
    `parent_id`    bigint(64)    NOT NULL DEFAULT '0' COMMENT '父公司ID',
    `ids`          varchar(1024) NOT NULL DEFAULT '' COMMENT '公司ID序列，多个之间使用分隔符隔开',
    `names`        varchar(1024) NOT NULL DEFAULT '' COMMENT '公司名称序列，多个之间使用分隔符隔开',
    `codes`        varchar(1024) NOT NULL DEFAULT '' COMMENT '公司编码序列，多个之间使用分隔符隔开',
    `order_num`    int(11)       NOT NULL DEFAULT '0' COMMENT '排序号',
    `remark`       varchar(255)  NOT NULL DEFAULT '' COMMENT '备注',
    `tenant_id`    bigint(64)    NOT NULL DEFAULT '2' COMMENT '租户id',
    `create_by`    bigint(64)    NOT NULL DEFAULT '2' COMMENT '创建者',
    `create_date`  timestamp     NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
    `update_by`    bigint(64)    NOT NULL DEFAULT '2' COMMENT '更新者',
    `update_date`  timestamp     NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间',
    `del_flag`     tinyint(4)    NOT NULL DEFAULT '0' COMMENT '删除标记0:保留，1:删除',
    PRIMARY KEY (`id`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8mb4
  COLLATE = utf8mb4_bin COMMENT ='公司表';


--
-- Table structure for table `gc_config`
--

DROP TABLE IF EXISTS `gc_config`;
CREATE TABLE `gc_config`
(
    `id`           bigint(64)   NOT NULL AUTO_INCREMENT COMMENT '主键',
    `config_key`   varchar(255) NOT NULL DEFAULT '' COMMENT '参数建名',
    `config_value` varchar(255) NOT NULL DEFAULT '' COMMENT '参数键值',
    `is_sys`       tinyint(4)   NOT NULL DEFAULT '1' COMMENT '是否系统内置0:是,1:否',
    `remark`       varchar(255) NOT NULL DEFAULT '' COMMENT '备注',
    `tenant_id`    bigint(64)   NOT NULL DEFAULT '2' COMMENT '租户id',
    `org_id`       bigint(64)   NOT NULL DEFAULT '1' COMMENT '机构id',
    `create_by`    bigint(64)   NOT NULL DEFAULT '2' COMMENT '创建者',
    `create_date`  timestamp    NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
    `update_by`    bigint(64)   NOT NULL DEFAULT '2' COMMENT '更新者',
    `update_date`  timestamp    NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间',
    `del_flag`     tinyint(4)   NOT NULL DEFAULT '0' COMMENT '删除标记0:保留,1:删除',
    PRIMARY KEY (`id`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8mb4
  COLLATE = utf8mb4_bin COMMENT ='参数配置表';


--
-- Table structure for table `gc_dict`
--

DROP TABLE IF EXISTS `gc_dict`;
CREATE TABLE `gc_dict`
(
    `id`          bigint(64)   NOT NULL AUTO_INCREMENT COMMENT '主键',
    `name`        varchar(255) NOT NULL DEFAULT '' COMMENT '名称',
    `code`        varchar(255) NOT NULL DEFAULT '' COMMENT '编码',
    `remark`      varchar(255) NOT NULL DEFAULT '' COMMENT '备注',
    `tenant_id`   bigint(64)   NOT NULL DEFAULT '2' COMMENT '租户id',
    `org_id`      bigint(64)   NOT NULL DEFAULT '1' COMMENT '机构id',
    `create_by`   bigint(64)   NOT NULL DEFAULT '2' COMMENT '创建者',
    `create_date` timestamp    NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
    `update_by`   bigint(64)   NOT NULL DEFAULT '2' COMMENT '更新者',
    `update_date` timestamp    NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间',
    `del_flag`    tinyint(4)   NOT NULL DEFAULT '0' COMMENT '删除标记0:保留,1:删除',
    PRIMARY KEY (`id`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8mb4
  COLLATE = utf8mb4_bin COMMENT ='字典表';

--
-- Table structure for table `gc_dict_item`
--

DROP TABLE IF EXISTS `gc_dict_item`;
CREATE TABLE `gc_dict_item`
(
    `id`          bigint(64)   NOT NULL AUTO_INCREMENT COMMENT '主键',
    `dict_code`   varchar(64)  NOT NULL DEFAULT '' COMMENT '字典编码',
    `name`        varchar(255) NOT NULL DEFAULT '' COMMENT '字典名称',
    `value`       varchar(255) NOT NULL DEFAULT '' COMMENT '字典值',
    `remark`      varchar(255) NOT NULL DEFAULT '' COMMENT '备注',
    `order_num`   int(11)      NOT NULL DEFAULT '0' COMMENT '排序号',
    `status`      tinyint(4)   NOT NULL DEFAULT '0' COMMENT '状态0:正常,1:禁用',
    `tenant_id`   bigint(64)   NOT NULL DEFAULT '2' COMMENT '租户id',
    `org_id`      bigint(64)   NOT NULL DEFAULT '1' COMMENT '机构id',
    `create_by`   bigint(64)   NOT NULL DEFAULT '2' COMMENT '创建者',
    `create_date` timestamp    NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
    `update_by`   bigint(64)   NOT NULL DEFAULT '2' COMMENT '更新者',
    `update_date` timestamp    NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间',
    `del_flag`    tinyint(4)   NOT NULL DEFAULT '0' COMMENT '删除标记0:保留,1:删除',
    PRIMARY KEY (`id`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8mb4
  COLLATE = utf8mb4_bin COMMENT ='业务字典项表';


--
-- Table structure for table `gc_file`
--

DROP TABLE IF EXISTS `gc_file`;
CREATE TABLE `gc_file`
(
    `id`             bigint(64)   NOT NULL AUTO_INCREMENT COMMENT '主键',
    `module`         varchar(255) NOT NULL DEFAULT '' COMMENT '模块/类型',
    `original_name`  varchar(255) NOT NULL DEFAULT '' COMMENT '原文件名',
    `new_name`       varchar(255) NOT NULL DEFAULT '' COMMENT '新文件名',
    `extension`      varchar(20)  NOT NULL DEFAULT '' COMMENT '后缀名(如: txt、png、doc、java等)',
    `path`           varchar(255) NOT NULL DEFAULT '' COMMENT '路径',
    `url`            varchar(255) NOT NULL DEFAULT '' COMMENT '访问路径',
    `size`           bigint(64)   NOT NULL DEFAULT '0' COMMENT '文件大小',
    `download_count` int(11)      NOT NULL DEFAULT '0' COMMENT '下载次数',
    `user_name`      varchar(20)  NOT NULL DEFAULT '' COMMENT '上传用户',
    `create_by`      bigint(64)   NOT NULL DEFAULT '2' COMMENT '创建者',
    `create_date`    timestamp    NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
    `update_by`      bigint(64)   NOT NULL DEFAULT '2' COMMENT '更新者',
    `update_date`    timestamp    NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间',
    `del_flag`       tinyint(4)   NOT NULL DEFAULT '0' COMMENT '删除标记0:保留，1:删除',
    `bucket`         varchar(100) NOT NULL DEFAULT 'gc-starter' COMMENT '桶名称',
    PRIMARY KEY (`id`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8mb4
  COLLATE = utf8mb4_bin COMMENT ='文件表';


--
-- Table structure for table `gc_job`
--

DROP TABLE IF EXISTS `gc_job`;
CREATE TABLE `gc_job`
(
    `id`                bigint(11)    NOT NULL AUTO_INCREMENT COMMENT '任务id',
    `type`              tinyint(4)    NOT NULL DEFAULT '1' COMMENT '任务类型1:javaBean、2:springBean、3:http、4:函数',
    `http_type`         tinyint(4)    NOT NULL DEFAULT '1' COMMENT '请求类型，1：同步，2：异步',
    `http_url`          varchar(255)  NOT NULL DEFAULT '' COMMENT 'URL',
    `http_method`       tinyint(4)    NOT NULL DEFAULT '1' COMMENT '请求方式，1：get,2:post',
    `http_content_type` varchar(255)  NOT NULL DEFAULT '' COMMENT 'ContentType',
    `http_header`       varchar(2000) NOT NULL DEFAULT '' COMMENT 'Header',
    `http_body`         varchar(2000) NOT NULL DEFAULT '' COMMENT 'body',
    `class_name`        varchar(200)  NOT NULL DEFAULT '' COMMENT 'java类名全路径',
    `bean_name`         varchar(200)  NOT NULL DEFAULT '' COMMENT 'spring bean',
    `method_name`       varchar(100)  NOT NULL DEFAULT '' COMMENT '方法名',
    `params`            varchar(2000) NOT NULL DEFAULT '' COMMENT '参数',
    `cron_expression`   varchar(100)  NOT NULL DEFAULT '' COMMENT 'cron表达式',
    `status`            tinyint(4)    NOT NULL DEFAULT '0' COMMENT '任务状态  0：正常  1：暂停',
    `functions`         varchar(1024) NOT NULL DEFAULT '' COMMENT '定时函数',
    `remark`            varchar(255)  NOT NULL DEFAULT '' COMMENT '备注',
    `tenant_id`         bigint(64)    NOT NULL DEFAULT '2' COMMENT '租户ID',
    `org_id`            bigint(64)    NOT NULL DEFAULT '1' COMMENT '机构ID',
    `create_by`         bigint(64)    NOT NULL DEFAULT '2' COMMENT '创建者',
    `create_date`       timestamp     NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
    `update_by`         bigint(64)    NOT NULL DEFAULT '2' COMMENT '更新者',
    `update_date`       timestamp     NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间',
    `del_flag`          tinyint(4)    NOT NULL DEFAULT '0' COMMENT '删除标记0:保留,1:删除',
    PRIMARY KEY (`id`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8mb4
  COLLATE = utf8mb4_bin COMMENT ='定时任务表';

--
-- Table structure for table `gc_job_log`
--

DROP TABLE IF EXISTS `gc_job_log`;
CREATE TABLE `gc_job_log`
(
    `id`          bigint(11)    NOT NULL AUTO_INCREMENT COMMENT '任务日志id',
    `job_id`      bigint(11)    NOT NULL DEFAULT '1' COMMENT '任务id',
    `class_name`  varchar(200)  NOT NULL DEFAULT '' COMMENT 'spring bean名称',
    `method_name` varchar(100)  NOT NULL DEFAULT '' COMMENT '方法名',
    `remark`      varchar(255)  NOT NULL DEFAULT '' COMMENT '备注',
    `params`      varchar(2000) NOT NULL DEFAULT '' COMMENT '参数',
    `status`      tinyint(4)    NOT NULL DEFAULT '0' COMMENT '任务状态 0：成功 1：失败',
    `error`       varchar(2000) NOT NULL DEFAULT '' COMMENT '失败信息',
    `times`       int(11)       NOT NULL DEFAULT '0' COMMENT '耗时(单位：毫秒)',
    `type`        tinyint(4)    NOT NULL DEFAULT '1' COMMENT '任务类型:1:javaBean、2:springBean、3:http、4:函数',
    `http_url`    varchar(255)  NOT NULL DEFAULT '' COMMENT 'HTTP接口地址',
    `bean_name`   varchar(200)  NOT NULL DEFAULT '' COMMENT 'SpringBean名称',
    `functions`   varchar(1024) NOT NULL DEFAULT '' COMMENT '定时函数',
    `tenant_id`   bigint(64)    NOT NULL DEFAULT '2' COMMENT '租户ID',
    `org_id`      bigint(64)    NOT NULL DEFAULT '1' COMMENT '机构ID',
    `create_by`   bigint(64)    NOT NULL DEFAULT '2' COMMENT '创建者',
    `create_date` timestamp     NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
    `del_flag`    tinyint(4)    NOT NULL DEFAULT '0' COMMENT '删除标记0:保留,1:删除',
    PRIMARY KEY (`id`),
    KEY `job_id` (`job_id`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8mb4
  COLLATE = utf8mb4_bin COMMENT ='定时任务日志表';

--
-- Table structure for table `gc_log`
--

DROP TABLE IF EXISTS `gc_log`;
CREATE TABLE `gc_log`
(
    `id`             bigint(64)    NOT NULL AUTO_INCREMENT COMMENT '系统日志id',
    `type`           tinyint(4)    NOT NULL DEFAULT '1' COMMENT '日志类型 1:新增2:删除3:更新4:查询5:上传文件6:下载文件7:用户导入8:用户导出9:登录10:登出11:其他',
    `state`          tinyint(4)    NOT NULL DEFAULT '2' COMMENT '日志状态 1:失败,2:成功',
    `username`       varchar(255)  NOT NULL DEFAULT '' COMMENT '用户名',
    `real_name`      varchar(255)  NOT NULL DEFAULT '' COMMENT '真实姓名',
    `module`         varchar(255)  NOT NULL DEFAULT '' COMMENT '模块名',
    `operation`      varchar(255)  NOT NULL DEFAULT '' COMMENT '操作',
    `method`         varchar(255)  NOT NULL DEFAULT '' COMMENT '调用方法',
    `client_ip`      varchar(255)  NOT NULL DEFAULT '' COMMENT '客户端IP',
    `device_name`    varchar(50)   NOT NULL DEFAULT '' COMMENT '设备名称',
    `browser_name`   varchar(50)   NOT NULL DEFAULT '' COMMENT '浏览器名称',
    `user_agent`     varchar(255)  NOT NULL DEFAULT '' COMMENT '用户代理',
    `request_uri`    varchar(255)  NOT NULL DEFAULT '' COMMENT '请求地址',
    `request_method` varchar(20)   NOT NULL DEFAULT '' COMMENT '请求方法',
    `exception`      varchar(2000) NOT NULL DEFAULT '' COMMENT '异常信息',
    `query_string`   varchar(2000) NOT NULL DEFAULT '' COMMENT '查询条件',
    `params`         varchar(2000) NOT NULL DEFAULT '' COMMENT '请求参数',
    `elapsed_time`   bigint(20)    NOT NULL DEFAULT '0' COMMENT '耗时',
    `tenant_id`      bigint(64)    NOT NULL DEFAULT '2' COMMENT '租户id',
    `org_id`         bigint(64)    NOT NULL DEFAULT '1' COMMENT '机构ID',
    `create_by`      bigint(64)    NOT NULL DEFAULT '2' COMMENT '创建者',
    `create_date`    timestamp     NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
    PRIMARY KEY (`id`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8mb4
  COLLATE = utf8mb4_bin COMMENT ='系统日志表';

--
-- Table structure for table `gc_menu`
--

DROP TABLE IF EXISTS `gc_menu`;
CREATE TABLE `gc_menu`
(
    `id`             bigint(64)    NOT NULL AUTO_INCREMENT COMMENT '主键id',
    `name`           varchar(64)   NOT NULL DEFAULT '' COMMENT '名称',
    `has_children`   tinyint(4)    NOT NULL DEFAULT '0' COMMENT '是否有子节点',
    `type`           tinyint(4)    NOT NULL DEFAULT '1' COMMENT '类型 0：目录 1：菜单 2：按钮 3：数据规则',
    `component`      varchar(64)   NOT NULL DEFAULT '' COMMENT '组件地址',
    `merge_route`    int(11)       NOT NULL DEFAULT '0' COMMENT '是否是聚合路由，0:否，1:是',
    `wrap_component` varchar(64)   NOT NULL DEFAULT '' COMMENT '包裹组件地址',
    `path`           varchar(500)  NOT NULL DEFAULT '' COMMENT '菜单路由地址',
    `parent_id`      bigint(64)    NOT NULL DEFAULT '0' COMMENT '父菜单id',
    `disabled`       tinyint(1)    NOT NULL DEFAULT '0' COMMENT '是否禁用1:是,0:否',
    `order_num`      int(11)       NOT NULL DEFAULT '999' COMMENT '排序编码',
    `permissions`    varchar(500)  NOT NULL DEFAULT '' COMMENT '授权',
    `icon`           varchar(500)  NOT NULL DEFAULT '' COMMENT '菜单图标',
    `target`         varchar(8)    NOT NULL DEFAULT '1' COMMENT '打开方式 1: 内部打开，2: 新窗口打开,系统内置:_self',
    `keep_alive`     tinyint(4)    NOT NULL DEFAULT '0' COMMENT '是否缓存1:是,0否',
    `hide`           tinyint(4)    NOT NULL DEFAULT '0' COMMENT '是否隐藏1:是,0否',
    `params`         varchar(500)  NOT NULL DEFAULT '' COMMENT '菜单打开携带参数',
    `rule_code`      varchar(255)  NOT NULL DEFAULT '' COMMENT '规则编码',
    `rule_column`    varchar(255)  NOT NULL DEFAULT '' COMMENT '规则字段',
    `rule_condition` varchar(50)   NOT NULL DEFAULT '' COMMENT '规则条件',
    `rule_value`     varchar(255)  NOT NULL DEFAULT '' COMMENT '规则值',
    `tenant_id`      bigint(64)    NOT NULL DEFAULT '2' COMMENT '租户id',
    `create_by`      bigint(64)    NOT NULL DEFAULT '2' COMMENT '创建者',
    `create_date`    timestamp     NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
    `update_by`      bigint(64)    NOT NULL DEFAULT '2' COMMENT '更新者',
    `update_date`    timestamp     NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间',
    `del_flag`       tinyint(4)    NOT NULL DEFAULT '0' COMMENT '删除标记0:保留,1:删除',
    `iframe_url`     varchar(1024) NOT NULL DEFAULT '' COMMENT '外链地址(支持表达式，格式为${xxx})',
    `code`           varchar(255)  NOT NULL DEFAULT '' COMMENT '编码(可用于业务区分)',
    `home`           tinyint(4)    NOT NULL DEFAULT '0' COMMENT '是否是首页',
    `top`            tinyint(4)    NOT NULL DEFAULT '0' COMMENT '是否顶部展示；特定布局有效',
    `tip_disabled`   tinyint(4)    NOT NULL DEFAULT '1' COMMENT '文本提醒是否启用',
    `tip_from`       int(11)       NOT NULL DEFAULT '3' COMMENT '文本提醒信息来源',
    `tip_script`     varchar(250)  NOT NULL DEFAULT ' ' COMMENT '文本提醒来源脚本',
    `remark`         varchar(250)  NOT NULL DEFAULT ' ' COMMENT '菜单说明',
    `module_code`    varchar(255)  NOT NULL DEFAULT 'sys' COMMENT '模块编码',
    PRIMARY KEY (`id`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8mb4
  COLLATE = utf8mb4_bin COMMENT ='菜单表';


--
-- Table structure for table `gc_notice`
--

DROP TABLE IF EXISTS `gc_notice`;
CREATE TABLE `gc_notice`
(
    `id`           bigint(64)   NOT NULL AUTO_INCREMENT COMMENT '主键',
    `title`        varchar(255) NOT NULL DEFAULT '' COMMENT '公告标题',
    `type`         varchar(11)  NOT NULL COMMENT '公告栏目',
    `digest`       varchar(255) NOT NULL COMMENT '摘要',
    `content`      text         NOT NULL COMMENT '公告内容',
    `status`       tinyint(4)   NOT NULL DEFAULT '0' COMMENT '公告状态,0在线，1下线，2草稿',
    `stick_top`    tinyint(4)   NOT NULL DEFAULT '0' COMMENT '置顶0：默认;1：置顶',
    `attachment`   varchar(255) NOT NULL DEFAULT '' COMMENT '附件',
    `reply_enable` tinyint(1)   NOT NULL DEFAULT '1' COMMENT '是否开启回复0：否;1：开启',
    `reply_num`    int(11)      NOT NULL DEFAULT '0' COMMENT '回复次数',
    `read_num`     int(11)      NOT NULL DEFAULT '0' COMMENT '阅读次数',
    `start_date`   timestamp    NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '上线时间',
    `end_date`     timestamp    NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '下线时间',
    `tenant_id`    bigint(64)   NOT NULL DEFAULT '2' COMMENT '租户id',
    `org_id`       bigint(64)   NOT NULL DEFAULT '1' COMMENT '机构id',
    `create_by`    bigint(64)   NOT NULL DEFAULT '2' COMMENT '创建者',
    `create_date`  timestamp    NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
    `update_by`    bigint(64)   NOT NULL DEFAULT '2' COMMENT '更新者',
    `update_date`  timestamp    NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间',
